INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CALM', 'STOCK', 'Cal-Maine Foods, Inc.', 'NMS', 'Consumer Defensive', 'Farm Products', 'Cal-Maine Foods, Inc. is primarily engaged in the production, packaging, marketing and distribution of fresh shell eggs, including conventional, cage-free, organic, brown, free-range, pasture-raised and nutritionally enhanced eggs, as well as a variety of ready-to-eat egg products. The Companys integrated operations consist of hatching chicks, growing and maintaining flocks of pullets, layers and breeders, manufacturing feed, and producing, processing, packaging, and distributing shell eggs. The Company provides specialty and conventional eggs. Specialty eggs encompass a broad range of products, such as cage-free, organic, brown, free-range, pasture-raised and nutritionally enhanced eggs. Its Farmhouse Eggs brand eggs are produced at its facilities by hens that are provided with a vegetarian diet. It markets organic, vegetarian and omega-3 eggs under its 4-Grain brand, which consists of conventional and cage-free eggs. Its Sunups and Sunny Meadow brands are sold as conventional eggs.', 'Ridgeland, MS, United States', 3683);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ADCT', 'STOCK', 'ADC Therapeutics SA', 'NYQ', 'Healthcare', 'Biotechnology', 'ADC Therapeutics SA is a Switzerland-based clinical-stage oncology drug discovery and development company. It develops antibody drug conjugates (ADCs) for the treatment of both solid and hematological cancers. It employs monoclonal antibodies specific to particular tumor antigens conjugated to a class of pyrrolobenzodiazepine (PBD)-based warheads to selectively target and kill cancer cells. The Company has multiple PBD-based ADCs in ongoing clinical trials, ranging from first in human to pivotal Phase II clinical trials, and numerous preclinical ADCs in development. Its main drug candidates are ADCT-301 for the treatment of lymphoma and leukemia and ADCT-402 for the treatment of non-Hodgkins lymphoma and B-cell leukemia. It serves customers in the United States, Switzerland, and the United Kingdom.', 'Epalinges, , Switzerland', 263);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COGT', 'STOCK', 'Cogent Biosciences, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Cogent Biosciences, Inc. is a biotechnology company. The Company is focused on developing precision therapies for genetically defined diseases. The Companys clinical program, bezuclastinib, is a selective tyrosine kinase inhibitor that is designed to potently inhibit the KIT D816V mutation as well as other mutations in KIT exon 17. KIT D816V is responsible for driving systemic mastocytosis, a serious disease caused by unchecked proliferation of mast cells. In addition to bezuclastinib, the Company is developing a portfolio of novel targeted therapies to help patients fighting serious, genetically driven diseases initially targeting mutations in FGFR2, ErbB2 and PI3K?. SUMMIT is its randomized, global, multicenter, double-blind, placebo-controlled, multi-part Phase II clinical trial for patients with Non-AdvSM. APEX is an open-label, global, multicenter study evaluating the safety, efficacy, pharmacokinetic, and pharmacodynamic profiles of bezuclastinib.', 'Waltham, MA, United States', 205);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DK', 'STOCK', 'Delek US Holdings, Inc.', 'NYQ', 'Energy', 'Oil & Gas Refining & Marketing', 'Delek US Holdings, Inc. is a diversified downstream energy company with assets in petroleum refining, logistics, pipelines, and renewable fuels. The Company''s segments include Refining and Logistics. The Refining segment processes crude oil and other feedstocks for the manufacture of transportation motor fuels, including various grades of gasoline, diesel fuel and aviation fuel, asphalt and other petroleum-based products that are distributed through owned and third-party product terminals. The Refining segment also owns three biodiesel facilities, located in Crossett, Arkansas, Cleburne, Texas and New Albany, Mississippi. The Logistics segment is engaged in gathering, transporting and storing crude oil and natural gas, marketing, distributing, transporting and storing intermediate and refined products and disposing and recycling water in select regions of the southeastern United States and North Dakota, the Midland Basin in Texas, the Delaware Basin in New Mexico and West Texas.', 'Brentwood, TN, United States', 1987);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BYD', 'STOCK', 'Boyd Gaming Corporation', 'NYQ', 'Consumer Cyclical', 'Resorts & Casinos', 'Boyd Gaming Corporation is a gaming company. It operates over 28 gaming entertainment properties in 10 states, manager of a tribal casino in northern California, and owner and operator of Boyd Interactive, a B2B and B2C online casino gaming business. Its segments include Las Vegas Locals, Downtown Las Vegas, Midwest & South, and Online. The Las Vegas Locals segment consists of eight casinos in the Las Vegas metropolitan area. The Downtown Las Vegas segment consists of three properties: California Hotel and Casino, Fremont Hotel & Casino, and Main Street Station Hotel and Casino. Its Midwest & South properties consist of five land-based casinos, five dockside riverboat casinos, three racinos and four barge-based casinos that operate in nine states, predominantly in the Midwest and southern United States. The Online segment includes its online gaming operations through collaborative arrangements with third parties throughout the United States and the operations of Boyd Interactive.', 'Las Vegas, NV, United States', 16129);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BKD', 'STOCK', 'Brookdale Senior Living Inc.', 'NYQ', 'Healthcare', 'Medical Care Facilities', 'Brookdale Senior Living Inc. is a premier operator of senior living communities, operating and managing 665 communities in 41 states. The Company operates independent living, assisted living, memory care, and continuing care retirement communities. It operates through three segments: Independent Living; Assisted Living and Memory Care, Continuing Care Retirement Communities (CCRCs). Its Independent Living segment includes owned or leased communities that are primarily designed for middle to upper-income seniors who desire to live in a residential setting that feels like home, without the efforts of ownership. Its Assisted Living and Memory Care segment includes owned or leased communities that offer housing and 24-hour assistance with activities of daily living for the Company''s residents. The CCRCs segment includes large owned or leased communities that offer a variety of living arrangements and services to accommodate a broad spectrum of physical ability and healthcare needs.', 'Brentwood, TN, United States', 24480);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BC', 'STOCK', 'Brunswick Corporation', 'NYQ', 'Consumer Cyclical', 'Recreational Vehicles', 'Brunswick Corporation designs, manufactures and markets recreational marine products, including marine propulsion products and boats, as well as parts and accessories for the marine and RV markets. Its segments include Propulsion, Engine Parts and Accessories (Engine P&A), Navico Group and Boat. The Propulsion segment designs, manufactures and sells engines, controls, rigging, and propellers globally. The Engine P&A segment sells products such as engine parts and consumables including oils and lubricants, electrical products, boat parts and systems, and also includes its marine parts and accessories distribution businesses. The Navico Group segment designs, develops, manufactures, and markets products and systems for the marine and RV, specialty vehicle markets. The Boat segment consists of the Brunswick Boat Group (Boat Group), which manufactures and distributes recreational boats, and Business Acceleration. Its boat brands include Boston Whaler, Lund, Sea Ray and Bayliner.', 'Mettawa, IL, United States', 15000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATEC', 'STOCK', 'Alphatec Holdings, Inc.', 'NMS', 'Healthcare', 'Medical Devices', 'Alphatec Holdings, Inc., through its wholly owned subsidiaries, Alphatec Spine, Inc., EOS imaging S.A.S. and SafeOp Surgical, Inc., is a medical device company. The Company is focused on the design, development, and advancement of technology for better surgical treatment of spine disorders. The Company''s Organic Innovation Machine is focused on developing new approaches that integrate with its expanding Alpha InformatiX (AIX) Platform to better inform surgery and safely and reproducibly achieve the goals of spine surgery. Its technologies include AIX, positioners, access systems, implants and fixation systems, and biologics. Its AIX product platform comprises its EOS imaging system and VEA alignment mobile application, its SafeOp Neural InformatiX System and its navigation-enabled robotics platform (Valence). It has developed approach-specific patient positioning systems that integrate with its other access systems, providing for a more rigid construct and enhanced reproducibility.', 'Carlsbad, CA, United States', 867);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FHB', 'STOCK', 'First Hawaiian, Inc.', 'NMS', 'Financial Services', 'Banks - Regional', 'First Hawaiian, Inc. is a bank holding company. Its principal subsidiary is First Hawaiian Bank (the Bank). The Bank provides a range of banking services to consumer and commercial customers, including deposit products, lending services and wealth management and trust services. Its segments include Retail Banking, Commercial Banking and Treasury and Other. Its Retail Banking segment includes the financial products and services it provides to consumers and small businesses. Its Retail Banking segment also includes its wealth management services. Its Commercial Banking segment includes its corporate banking-related products, commercial real estate loans, commercial lease financing, secured and unsecured lines of credit, automobile loans and auto dealer financing, business deposit products and credit cards. Its Treasury and Other segment include its treasury business, which consists of corporate asset and liability management activities, including interest rate risk management.', 'Honolulu, HI, United States', 2006);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BRFS', 'STOCK', 'BRF S.A.', 'NYQ', 'Consumer Defensive', 'Packaged Foods', 'A BRF S.A. é uma empresa multinacional brasileira que possui um portfólio diversificado de produtos e é um produtor de alimentos. Os segmentos da Companhia incluem Brasil, América Latina (LATAM), Médio Oriente e Norte da África (MENA), África e Outros Segmentos. Esses segmentos incluem vendas de todos os canais de distribuição e operações subdivididas em aves, suínos e outras, processadas e outras vendas. As operações avícolas incluem a produção e venda de cortes integrais e ao natural de aves. A carne suína e outras operações envolvem a produção e a venda de cortes naturais. As operações processadas incluem a produção e venda de alimentos processados, produtos congelados e processados derivados de produtos de aves, carne suína e bovina, margarina, produtos vegetais e à base de soja. As outras operações de vendas incluem a comercialização de farinha para serviço de alimentação e outras. Outros segmentos incluem a venda de cortes naturais de carne bovina, produtos agrícolas e ração anim', 'São Paulo, SP, Brazil', 100000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COWG', 'STOCK', 'Pacer US Large Cap Cash Cows Growth Leaders ETF', 'NGM', NULL, NULL, 'The index uses a rules-based methodology that seeks to provide exposure to large-capitalization U.S. companies with above average free cash flow margins. Under normal circumstances, the fund will seek to invest at least 80% of its net assets, plus the amount of any borrowings for investment purposes, in securities of large-capitalization companies (“large cap”) that are principally traded in the United States. It is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('WCC', 'STOCK', 'WESCO International, Inc.', 'NYQ', 'Industrials', 'Industrial Distribution', 'WESCO International, Inc. is a provider of business-to-business distribution, logistics services and supply chain solutions. The Company''s segments include Electrical & Electronic Solutions (EES), Communications & Security Solutions (CSS) and Utility & Broadband Solutions (UBS). EES segment supplies a range of products and solutions primarily to construction, industrial and original equipment manufacturer customers. EES product portfolio includes a range of electrical equipment and supplies, automation and connected devices, and others. CSS segment specializes in data center, network infrastructure and security solutions. In the security business, CSS offers on premise, cloud or hybrid comprehensive solutions for video surveillance, fire and intrusion detection, and others. UBS segment provides products and services to investor-owned utilities, public power companies, including municipalities, as well as global service providers, wireless providers, broadband operators and others.', 'Pittsburgh, PA, United States', 20000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EFC', 'STOCK', 'Ellington Financial Inc.', 'NYQ', 'Real Estate', 'REIT - Mortgage', 'Ellington Financial Inc. is a real estate investment trust. The Company acquires and manages mortgage-related, consumer-related, corporate-related, and other financial assets. The Companys segments include the Investment Portfolio Segment and the Longbridge Segment. The Investment Portfolio Segment is focused on investing in a diverse array of financial assets, including residential and commercial mortgage loans, residential mortgage-backed securities (RMBS), commercial mortgage-backed securities (CMBS), consumer loans and asset-backed securities (ABS), including ABS-backed by consumer loans, collateralized loan obligations (CLOs), non-mortgage- and mortgage-related derivatives, debt and equity investments in loan origination companies, and other strategic investments. The Longbridge Segment is focused on the origination and servicing of, and investment in, reverse mortgage loans. The Company is externally managed and advised by Ellington Financial Management LLC.', 'Old Greenwich, CT, United States', 400);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DE', 'STOCK', 'Deere & Company', 'NYQ', 'Industrials', 'Farm & Heavy Construction Machinery', 'A Deere & Company está envolvida na entrega de equipamentos agrícolas, de construção e florestais. Seus segmentos incluem agricultura de produção e precisão (PPA), pequena agricultura e turfa (SAT), construção e silvicultura (CF) e serviços financeiros (FS). O segmento PPA define, desenvolve e entrega equipamentos e soluções tecnológicas globais para produtores em escala de produção de grãos grandes, grãos pequenos, algodão e cana-de-açúcar. A SAT Segment define, desenvolve e fornece equipamentos e soluções tecnológicas globais para produtores de laticínios e gado, produtores de culturas de pequeno porte e alto valor, e clientes de gramados e serviços públicos. O segmento CF define, desenvolve e fornece uma gama de máquinas e soluções tecnológicas organizadas ao longo dos sistemas de produção de terraplanagem, silvicultura e construção de estradas. O segmento FS financia vendas e locações por revendedores John Deere de equipamentos novos e usados de produção e agricultura de precisão e', 'Moline, IL, United States', 75800);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BARK', 'STOCK', 'BARK, Inc.', 'NYQ', 'Consumer Cyclical', 'Specialty Retail', 'BARK, Inc. is a dog-centric company. The Company is an omnichannel brand serving dogs across two key categories: toys & accessories and consumables. All of its products are designed, developed, and branded by BARK. The Company''s segments include direct to consumer and commerce. Its products are sold Direct-to-Consumer (DTC) and through its network of retail partners. It offers BarkBox and Super Chewer, which are subscription products that feature monthly themed boxes of BARK toys and treats that are delivered directly to a dogs home. Customers have the option to subscribe to these products on a one-month, three-month, six-month, or twelve-month basis. The Company offers its customers incremental products via ATB, which allows it to cross-sell customers its full portfolio of products, including kibble, treats, toppers, dental, and more. Its toys and accessories category also includes other products such as beds, leashes, apparel, and other accessories.', 'New York, NY, United States', 691);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ELPW', 'STOCK', 'Elong Power Holding Limited', 'NGM', NULL, NULL, 'eLong Power Holding Ltd is a holding company principally engaged in the research and development, manufacturing, sales and service of high-power lithium-ion batteries. The Companys product portfolio includes products utilizing lithium manganese oxide and lithium iron phosphate, among others, to meet the needs of high-power applications and energy storage applications in various scenarios. The Companys products are used for electric vehicles and construction machinery, as well as large-capacity, long-cycle lithium-ion batteries for energy storage systems.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALLE', 'STOCK', 'Allegion plc', 'NYQ', 'Industrials', 'Security & Protection Services', 'A Allegion plc é um fornecedor global de produtos e soluções de segurança. A empresa assegura pessoas e ativos com uma gama de soluções para residências, empresas, escolas e instituições. Seu segmento Allegion Americas é um fornecedor de produtos, serviços e soluções de segurança em toda a América do Norte. Ela vende uma gama de produtos e soluções, incluindo fechaduras, locksets, sistemas chave, controles de porta e sistemas, dispositivos de saída, portas, acessórios, produtos de segurança eletrônica, sistemas de controle de acesso e soluções de software e serviços para clientes em instalações comerciais, institucionais e residenciais. Seu segmento internacional Allegion fornece produtos, serviços e soluções de segurança principalmente em toda a Europa, Ásia e Oceania. O segmento oferece aos usuários finais uma gama de produtos, serviços e soluções, incluindo fechaduras, locksets, fechaduras portáteis, sistemas chave, fechos de portas e sistemas, entre outros. Suas marcas incluem CISA', 'Dublin, , Ireland', 14400);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('APPN', 'STOCK', 'Appian Corporation', 'NGM', 'Technology', 'Software - Infrastructure', 'Appian Corporation is a software company that offers platform, which help organizations run better processes that reduce costs, and improve customer experiences. The Companys Appian platform is an integrated automation platform for process orchestration, automation, and intelligence. The platform provides everything an organization needs to design, automate, and optimize critical processes. Its capabilities include data fabric, robotic process automation (RPA); intelligent document processing (IDP); generative artificial intelligence (AI); AI agents; low-code design; application programming interfaces (APIs); and process intelligence capabilities in a single platform. Its data fabric is an integrated data layer that unifies data across systems without requiring companies to migrate their data. Its patented data fabric technology supports both analytical and transactional workloads, which allows users to build applications that create and update enterprise data.', 'McLean, VA, United States', 2033);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACAD', 'STOCK', 'ACADIA Pharmaceuticals Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Acadia Pharmaceuticals Inc. is a biopharmaceutical company. It develops and commercializes medicines that address unmet medical needs in central nervous system (CNS) disorders and rare diseases. It has a portfolio of product candidates and research programs that are designed to address significant unmet medical needs in CNS disorders and rare diseases. Its pipeline includes NUPLAZID (pimavanserin), DAYBUE (trofinetide), ACP-101, ACP-204, and ACP-711. NUPLAZID is a selective serotonin inverse agonist/antagonist preferentially targeting the 5-HT2A receptor. NUPLAZID is developed for the treatment for Parkinson''s Disease Psychosis. Trofinetide is a novel synthetic analog of the amino-terminal tripeptide of insulin-like growth factor 1 designed to treat the core symptoms of Rett syndrome by reducing neuroinflammation and supporting synaptic function. Its early-stage research programs and product candidates include ACP-211, ACP-2591, ACP-271, and Antisense Oligonucleotide (ASO) Programs.', 'San Diego, CA, United States', 653);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EFX', 'STOCK', 'Equifax Inc.', 'NYQ', 'Industrials', 'Consulting Services', 'A Equifax Inc. É uma empresa global de dados, análises e tecnologia. A empresa está envolvida em ajudar instituições financeiras, empresas, empregadores e agências governamentais a tomar decisões críticas. O segmento de Soluções de Força de Trabalho da Companhia oferece serviços que permitem aos clientes verificar renda, emprego, histórico educacional, dados de justiça criminal, licenciamento profissional de saúde e sanções de pessoas nos Estados Unidos. O segmento U.S. Information Solutions (USIS) da empresa fornece soluções de informação comercial e de consumo para empresas nos Estados Unidos, incluindo informações on-line, soluções de tecnologia de decisão, serviços de gestão de identidade, serviços analíticos, serviços de proteção contra fraudes e cobranças de comércio eletrônico, serviços de gestão de portfólio, informações sobre hipotecas e serviços de marketing. O segmento internacional da Companhia fornece produtos e serviços semelhantes aos disponíveis no segmento USIS, mas co', 'Atlanta, GA, United States', 15000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BNL', 'STOCK', 'Broadstone Net Lease, Inc.', 'NYQ', 'Real Estate', 'REIT - Diversified', 'Broadstone Net Lease, Inc. is an industrial-focused, diversified net lease real estate investment trust (REIT). The Company invests primarily in primarily single-tenant commercial real estate properties that are net leased on a long-term basis to a diversified group of tenants. It is primarily diversified across industrial and retail property types. Under industrial property type, it includes manufacturing, distribution and warehouse, food processing, flex and research and development, cold storage, and services. Under retail property type, it includes general merchandise, casual dining, quick service restaurants, automotive, animal services, home furnishings, healthcare services, and education. Under Other property type, it includes office and clinical/surgical. The Company''s portfolio consists of approximately 765 properties, with 758 properties located in 44 U.S. states and seven properties located in four Canadian provinces.', 'Victor, NY, United States', 73);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CAH', 'STOCK', 'Cardinal Health, Inc.', 'NYQ', 'Healthcare', 'Medical Distribution', 'A Cardinal Health, Inc. É uma empresa global de serviços e produtos de saúde. A empresa está envolvida no fornecimento de soluções personalizadas para hospitais, sistemas de saúde, farmácias, centros de cirurgia ambulatorial, laboratórios clínicos, consultórios médicos e pacientes em casa. A empresa também fornece produtos farmacêuticos e médicos. Os segmentos da Companhia incluem Soluções Farmacêuticas e Especializadas e Global Medical Products and Distribution (GMPD). O segmento de Soluções Farmacêuticas e Especializadas distribui produtos farmacêuticos de marca e genéricos, farmacêuticos especializados e produtos de consumo e cuidados de saúde de balcão nos Estados Unidos. Seu segmento GMPD fabrica, fornece e distribui produtos médicos, cirúrgicos e laboratoriais da marca Cardinal Health, vendidos nos Estados Unidos, Canadá, Europa, Ásia e outros mercados. A empresa coneta pacientes, prestadores, pagadores, farmacêuticos e fabricantes para coordenação integrada do cuidado.', 'Dublin, OH, United States', 53084);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('GORO', 'STOCK', 'Gold Resource Corporation', 'ASE', 'Basic Materials', 'Gold', 'Gold Resource Corporation is a gold and silver producer, developer, and explorer with its operations centered on the Don David Gold Mine in Oaxaca, Mexico. Base metals, critical to the United States, are also produced as a by-product. The Companys focus is to unlock the significant upside potential of its existing infrastructure and large land position surrounding the mine in Oaxaca, Mexico and to develop the Back Forty Project in Michigan, United States. Back Forty is a 100%-owned development-stage project delineating a gold-rich volcanogenic massive sulfide (VMS) deposit located along the mineral-rich Penokean Volcanic Belt in Michigans Upper Peninsula. Its segments include Oaxaca, Mexico, and Michigan, U.S.A. Oaxaca, Mexico represents the Companys only operating segment with a production stage property that produces copper, lead, and zinc concentrates that also contain gold and silver. Michigan, U.S.A. is an advanced exploration stage property with no current metal production.', 'Denver, CO, United States', 480);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('WH', 'STOCK', 'Wyndham Hotels & Resorts, Inc.', 'NYQ', 'Consumer Cyclical', 'Lodging', 'Wyndham Hotels & Resorts, Inc. is a hotel franchising company. The Company operates through one segment: Hotel Franchising. The Hotel Franchising segment consists of licensing its lodging brands and providing related services to third-party hotel owners and others. The Company operates approximately 9,300 hotels across over 95 countries on six continents. Through its network of approximately 903,000 rooms appealing to the everyday traveler. The Company operates a portfolio of 25 hotel brands, including Super 8, Days Inn, Ramada, Microtel, La Quinta, Baymont, Wingate, AmericInn, ECHO Suites, Registry Collection Hotels, Trademark Collection, and Wyndham.', 'Parsippany, NJ, United States', 2200);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALMS', 'STOCK', 'Alumis Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Alumis Inc. is a late-stage biopharmaceutical company. The Company is engaged in developing next-generation targeted therapies with the potential to significantly improve patient health and outcomes across a range of immune-mediated diseases. Leveraging its proprietary data analytics platform and precision approach, the Company is developing a pipeline of oral tyrosine kinase 2 (TYK2) inhibitors, consisting of ESK-001 for the treatment of systemic immune-mediated disorders, such as moderate-to-severe plaque psoriasis and systemic lupus erythematosus, and A-005 for the treatment of neuroinflammatory and neurodegenerative diseases such as multiple sclerosis and Parkinsons Disease. In addition, its pipeline also includes lonigutamab, a subcutaneously delivered anti-insulin-like growth factor 1 receptor therapy for the treatment of thyroid eye disease, as well as several preclinical programs identified through this precision approach.', 'South San Francisco, CA, United States', 182);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CIO', 'STOCK', 'City Office REIT, Inc.', 'NYQ', 'Real Estate', 'REIT - Office', 'City Office REIT, Inc. is an internally managed real estate company. The Company is focused on acquiring, owning and operating office properties located predominantly in Sun Belt markets. The Company owns around 22 properties comprising approximately 54 office buildings with a total of approximately 5.4 million square feet of net rentable area (NRA) in the metropolitan areas of Dallas, Denver, Orlando, Phoenix, Portland, Raleigh, San Diego, Seattle and Tampa. The Company''s properties include 2525 McKinnon, The Terraces, Circle Point, Denver Tech, Florida Research Park, 5090 North 40th Street, Papago Tech, Pima Center, San Tan, The Quad, AmberGlen, Bloc 83, Mission City, Canyon Park, Carillon Point, City Center, Intellicenter, and Park Tower.', 'Vancouver, BC, Canada', 20);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BTCT', 'STOCK', 'BTC Digital Ltd.', 'NCM', 'Technology', 'Computer Hardware', 'BTC Digital Ltd, formerly Meten Holding Group Ltd, is a holding company primarily engaged in the bitcoin mining business. The Company is also involved in mining machines resale and rental business operations.', 'Singapore, , Singapore', 21);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CCCC', 'STOCK', 'C4 Therapeutics, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'C4 Therapeutics, Inc. is a clinical-stage biopharmaceutical company. The Company is focused on delivering targeted protein degradation science to create a new generation of medicines that transform patients lives. The Company is focused on progressing targeted oncology programs through clinical studies and leveraging its TORPEDO platform to design and optimize small-molecule medicines to address difficult-to-treat diseases. Its advanced product candidate, cemsidomide, is an orally bioavailable MonoDAC degrader of protein targets called IKZF1 and IKZF3. Cemsidomide is in clinical development for multiple myeloma (MM), and non-Hodgkin lymphoma (NHL). Its CFT1946 is an orally bioavailable BiDAC degrader designed to be potent and selective against BRAF V600X mutant proteins. It is also developing CFT8919, an orally bioavailable, allosteric, mutant-selective BiDAC degrader of epidermal growth factor receptor (EGFR), with an L858R mutation in non-small lung cancer (NSCLC).', 'Watertown, MA, United States', 110);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CABA', 'STOCK', 'Cabaletta Bio, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Cabaletta Bio, Inc. is a clinical-stage biotechnology company focused on the discovery and development of engineered T cell therapies that have the potential to provide deep and durable, perhaps curative, responses with one-time administration for patients with autoimmune diseases. Its Cabaletta Approach to B cell Ablation (CABA) platform encompasses two strategies: Chimeric Antigen Receptor T cells for Autoimmunity (CARTA) and Chimeric AutoAntibody Receptor T cells (CAART). Resecabtagene autoleucel, its lead product candidate from its CARTA platform, is a 4-1BB co-stimulatory domain-containing fully human CD19-CAR T construct designed to treat patients with a range of autoimmune diseases. Its DSG3-CAART product candidate is being evaluated for the treatment of mPV, a subtype of PV that affects the epithelium of the mucous membranes, in the Phase 1 DesCAARTes TM trial. Its MuSK-CAART product candidate is designed to treat a subset of patients with MG, targeting autoreactive B cells.', 'Philadelphia, PA, United States', 167);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('A', 'STOCK', 'Agilent Technologies, Inc.', 'NYQ', 'Healthcare', 'Diagnostics & Research', 'A Agilent Technologies, Inc. É especializada em ciências da vida, diagnósticos e mercados aplicados, fornecendo soluções focadas em aplicações que incluem instrumentos, software, serviços e consumíveis para todo o fluxo de trabalho do laboratório. Seus segmentos incluem mercados de Ciências da Vida e Diagnóstico, Agilent CrossLab e Mercados Aplicados. O segmento de mercados de Ciências da Vida e Diagnóstico compreende sete áreas de atuação. Oferece ingredientes farmacêuticos ativos para terapias à base de oligo, bem como soluções que incluem reagentes, instrumentos, software e consumíveis. O segmento de CrossLab da Agilent oferece um portfólio de serviços e consumíveis que abrange todo o laboratório, além de soluções de automação de software e laboratório, projetadas para melhorar os resultados dos clientes. O segmento de Mercados Aplicados oferece soluções focadas em aplicações que incluem instrumentos e software que permitem aos clientes identificar, quantificar e analisar as proprie', 'Santa Clara, CA, United States', 18000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARQQ', 'STOCK', 'Arqit Quantum Inc.', 'NCM', 'Technology', 'Software - Infrastructure', 'Arqit Quantum Inc. is engaged in supplying encryption software services. The Companys encryption software service, which makes the communications links of any networked device, cloud machine or data at rest secure against both current and future forms of attack on encryption, even from a quantum computer. Its products and services include Arqit SKA Platform, Arqit NetworkSecure and Encryption Intelligence. Arqit SKA-Platform is a platform as a service that creates a secure global mesh between different cloud providers and on-premises data centers around the globe. SKA-Platform supplies the platform that enables end points to share data securely for the creation of new keys. It also allows the Company to provide secure services for customers to store, communicate and sign their data. NetworkSecure is a standardized interface for network devices, like firewalls, to agree quantum-safe symmetric keys and upgrade the security of VPN connections over Internet Security Protocol (IPsec).', 'London, , United Kingdom', 72);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DOOO', 'STOCK', 'BRP Inc.', 'NMS', 'Consumer Cyclical', 'Recreational Vehicles', 'BRP Inc. is a Canada-based company that specializes in powersports products, propulsion systems and boats. The Companys segments include Powersports and Marine. The Powersports segment comprises Year-Round Products (all-terrain vehicles, side-by-side vehicles, three-wheeled vehicles, and two-wheeled vehicles), Seasonal Products (snowmobiles, personal watercraft and pontoons) and Powersports PA&A and OEM Engines (parts, accessories and apparel (PA&A), engines for karts, recreational aircraft and jet boats, and other services). The Marine segment includes boats, pontoons, outboard engines and related PA&A, and other services. Its brands include Ski-Doo and Lynx snowmobiles, Sea-Doo watercraft and pontoons, Can-Am on and off-road vehicles, Alumacraft and Quintrex boats, Manitou pontoons and Rotax marine propulsion systems and Rotax engines for karts and recreational aircraft and Pinion gearboxes. It is developing electric models for its existing product lines.', 'Valcourt, QC, Canada', 16500);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CVI', 'STOCK', 'CVR Energy, Inc.', 'NYQ', 'Energy', 'Oil & Gas Refining & Marketing', 'CVR Energy, Inc. is a diversified holding company primarily engaged in the renewable fuels and petroleum refining and marketing businesses, as well as in the nitrogen fertilizer manufacturing business through its interest in CVR Partners, LP. The Company''s segments include Petroleum Segment, Renewables Segment and Nitrogen Fertilizer Segment. Petroleum Segment includes the refining and marketing of high value transportation fuels which consist of gasoline, diesel, jet fuel, and distillates. The Petroleum Segment also includes activities related to crude gathering and logistics that support the refinery operations. Renewables Segment includes the refining of renewable feedstocks, such as soybean oil, corn oil, and other renewable feedstocks, into renewable diesel and marketing of renewables products. Nitrogen Fertilizer Segment includes the production and distribution of nitrogen fertilizer products, primarily in the form of ammonia and urea ammonium nitrate, for the farming industry.', 'Sugar Land, TX, United States', 1595);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DOCU', 'STOCK', 'DocuSign, Inc.', 'NMS', 'Technology', 'Software - Application', 'A DocuSign, Inc. Oferece produtos de assinatura eletrônica, permitindo que um contrato seja assinado eletronicamente em uma variedade de dispositivos, de praticamente qualquer lugar do mundo. As ofertas de produtos da Empresa incluem o produto de assinatura eletrônica, que permite que as organizações façam negócios mais rapidamente com menos risco e com menor custo, proporcionando uma melhor experiência para os clientes. Ele também oferece software de gerenciamento de ciclo de vida de contratos que automatiza fluxos de trabalho pré e pós-assinatura. Isso inclui gerar automaticamente um contrato a partir de dados em outros sistemas, apoiar fluxos de trabalho de negociação, verificar identidades, permitir a notarização on-line remota, coletar pagamentos após assinaturas e usar inteligência artificial (IA) para analisar uma coleção de acordos para riscos e oportunidades. Seus produtos incluem eSignature, Contract Lifecycle Management (CLM), Gen for Salesforce, Identify and Monitor. Sua Ge', 'San Francisco, CA, United States', 6838);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('OPFI', 'STOCK', 'OppFi Inc.', 'NYQ', 'Financial Services', 'Credit Services', 'OppFi Inc. is a tech-enabled, mission-driven specialty finance platform. It provides customer experience in the industry and enables banks to offer credit products. Its primary product is offered by its OppLoans platform. The OppFi platform is a mobile-optimized online application where eligible applicants, at their request, are able to opt into the OppFi TurnUp Program. This program helps these applicants find more affordable credit options by checking the market voluntarily on their behalf for a sub-36% annual percentage rate, products offered by third-party lenders through other platforms. It collects and calculates more than 500 attributes on loan applications for use in underwriting decisions. These attributes are based on data from credit bureaus, bank transactions and loan applications. Using this information, OppFi generates a score in combination with scores generated by third-party providers. It offers a same-day funding service in collaboration with its partner banks.', 'Chicago, IL, United States', 445);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ESRT', 'STOCK', 'Empire State Realty Trust, Inc.', 'NYQ', 'Real Estate', 'REIT - Diversified', 'Empire State Realty Trust, Inc. is a real estate investment trust (REIT), which owns and operates a portfolio of office, retail and multifamily assets. The Companys portfolio consists of approximately 7.8 million rentable square feet of office space, 0.8 million rentable square feet of retail space and 732 residential units. Its office portfolio included 10 properties. Nine of these office properties are located in midtown Manhattan and encompass over 7.6 million rentable square feet of office space and 0.5 million rentable square feet of retail space, including the Empire State Building. The Companys segments include Real Estate and an Observatory. The Real Estate segment includes all activities related to the ownership, management, operation, acquisition, repositioning and disposition of its office, retail and multifamily assets principally located in New York City. The Observatory segment operates the 86th and 102nd floor observatories in the Empire State Building.', 'New York, NY, United States', 667);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ADNT', 'STOCK', 'Adient plc', 'NYQ', 'Consumer Cyclical', 'Auto Parts', 'Adient PLC is an automotive seating supplier company. The Companys automotive seating solutions include complete seating systems, frames, mechanisms, foam, head restraints, armrests and trim covers. The Company designs, manufactures and markets a full range of seating systems and components for passenger cars, commercial vehicles and light trucks, including vans, pick-up trucks and sport/crossover utility vehicles. The Company manages its business on a geographic basis and operates in three reportable segments: Americas, which is inclusive of North America and South America; Europe, Middle East, and Africa (EMEA), and Asia Pacific/China (Asia). The Company operates approximately 200 wholly- and majority-owned manufacturing or assembly facilities, with operations in approximately 29 countries. The Company provides production and service parts to its customers under multi-year programs.', 'Dublin, , Ireland', 70000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASBP', 'STOCK', 'Aspire Biopharma Holdings, Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Aspire Biopharma Holdings, Inc. is an early-stage biopharmaceutical company. It develops and markets a technology for novel delivery mechanisms for FDA approved drugs, nutraceuticals, and supplements. It has developed and acquired technologies that are a Novel Soluble Formulation which address emergencies and drug efficacy, dosage management, and response time. Its Sublingual Aspirin Product, which addresses cardiology emergencies and pain management, is a granular or powder formulation of a soluble, Ph-neutral, fast-acting aspirin. It also has numerous pharmaceutical and nutraceutical applications under development in various areas, including but not limited to a Viagra/Cialis combination product which is faster acting, requiring decreased dosages with the benefit of a longer half-life, various bi-hormonal drugs such as testosterone, estrogen and weight loss drugs, and thyroid drugs, as well as various supplements including a rapid-absorbing pre-workout and a melatonin sleep aid.', 'Estero, FL, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BIRK', 'STOCK', 'Birkenstock Holding plc', 'NYQ', 'Consumer Cyclical', 'Footwear & Accessories', 'Birkenstock Holding plc operates through Birkenstock Group B.V. & Co. KG and its subsidiaries. Birkenstock is a global brand, which has developed a unisex portfolio of footbed-based products, anchored by its Core Silhouettes, the Madrid, Arizona, Boston, Gizeh and Mayari. Its proprietary footbed, which reflects the anatomy of the human foot, represents the foundation of its brand and products. It operates a vertically integrated manufacturing base and produce all its footbeds in Germany. In addition, it assembles the majority of its products in Germany and produce the remainder elsewhere in the European Union. The Company operates its channels, utilizing the business-to-business (B2B) channel to facilitate brand accessibility while fully engaging consumers in its direct-to-consumer (DTC) channel, which offers its complete product range and access to its silhouettes.', 'London, , United Kingdom', 6200);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BNS', 'STOCK', 'The Bank of Nova Scotia', 'NYQ', 'Financial Services', 'Banks - Diversified', 'O Banco da Nova Escócia (o Banco) é um banco fretado canadense. Os segmentos do Banco incluem Canadian Banking, International Banking, Global Wealth Management, Global Banking and Markets, e outros. O segmento bancário canadense fornece um conjunto completo de consultoria financeira e soluções bancárias. O segmento de Banca Internacional é uma franquia diversificada que oferece consultoria financeira e soluções para clientes de varejo, corporativos e comerciais. O segmento Global Wealth Management está focado em fornecer consultoria e soluções abrangentes de gestão de patrimônio para clientes em toda a área de atuação do Banco. O segmento Global Wealth Management atende clientes de fundos de investimento e consultoria em 13 países. O segmento Global Banking and Markets fornece aos clientes corporativos serviços de empréstimo e transação, consultoria bancária de investimento e acesso aos mercados de capitais. O outro segmento inclui Tesouraria de Grupo, segmentos operacionais menores e ', 'Toronto, ON, Canada', 86746);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLM', 'STOCK', 'Cornerstone Strategic Investment Fund, Inc.', 'ASE', 'Financial Services', 'Asset Management', 'Cornerstone Strategic Value Fund, Inc. is a closed-ended equity mutual fund launched and managed by Cornerstone Advisors, LLC. The fund invests in public equity markets across the globe. It seeks to invest in stocks of companies operating across diversified sectors. The fund primarily invests in value and growth stocks of companies. It also invests through other closed-end investment companies and ETF''s. Cornerstone Strategic Value Fund, Inc. was formed on May 1, 1987 and is domiciled in the United States.', 'Asheville, NC, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DAN', 'STOCK', 'Dana Incorporated', 'NYQ', 'Consumer Cyclical', 'Auto Parts', 'Dana Incorporated is engaged in the design and manufacture of propulsion and energy-management solutions that power vehicles and machines in all mobility markets across the globe. The Company is shaping sustainable progress through its conventional and clean-energy solutions that support nearly every vehicle manufacturer with drive and motion systems, and electrodynamic technologies. It offers axles, driveshafts, transmissions, sealing and thermal products to electrification products, including motors, inverters, controllers, e-sealing, e-thermal and digital solutions. The Company operates in four segments: Light Vehicle Drive Systems, Commercial Vehicle Drive and Motion Systems, Off-Highway Drive and Motion Systems, and Power Technologies. It owns and has licensed trademarks, such as Spicer Electrified, Victor Reinz, Long, Graziano and Dana TM4. It operates in North America, Europe, South America and Asia Pacific regions. Its North America includes Canada, Mexico and the USA.', 'Maumee, OH, United States', 28000);\n
